import React from 'react';
import cart from "../assets/images/cart.png"

const NavBar = () => {
    return (
        <div className={"navbar"}>
            <p className="navbar__logo">Panto</p>
            <div className="navbar__nav">
                <p className="navbar__nav__item">Furniture</p>
                <p className="navbar__nav__item">Shop</p>
                <p className="navbar__nav__item">About us</p>
                <p className="navbar__nav__item">Contact</p>
            </div>
            <img src={"https://www.figma.com/file/Jblfdxi5Wq0jLQywJ2beH5/Furniture-Landing-Page-%7C-Panto-Web-Design-(Community)?node-id=1%3A2&t=SSlLGS62WN9tkojl-1"} alt={"cart"} className="navbar__cart"></img>
        </div>
    );
};

export default NavBar;
